\
function verifyPitLight()\
\9if( GameMode.getTimeOfDay() > 0.95 ) then\
\9\9mine_ceiling_pit_light_bright_1.light:fadeOut(25)\
\9else\
\9\9mine_ceiling_pit_light_bright_1.light:fadeIn(25)\
\9end\
end\
\
function bossLightOn()\
\9local lightOn = vec(1.3, 0.68, 0.35, 0)\
\9\
\9if( bossCounter.counter:getValue() == 0 ) then\
\9\9torchBoss1.light:setColor(lightOn)\
\9\9torchBoss1.particle:fadeIn(0.001) \
\9\9torchBoss1.sound:play(\"torch_burning\")\9\9\
\9\9\
\9\9torchBoss2.light:setColor(lightOn)\
\9\9torchBoss2.particle:fadeIn(0.001) \
\9\9torchBoss2.sound:play(\"torch_burning\")\
\9\9\
\9\9bossCounter.counter:increment()\
\9elseif( bossCounter.counter:getValue() == 1 ) then\
\9\9torchBoss3.light:setColor(lightOn)\
\9\9torchBoss3.particle:fadeIn(0.001) \
\9\9torchBoss3.sound:play(\"torch_burning\")\
\9\9\
\9\9torchBoss4.light:setColor(lightOn)\
\9\9torchBoss4.particle:fadeIn(0.001) \
\9\9torchBoss4.sound:play(\"torch_burning\")\
\9\9\
\9\9bossCounter.counter:increment()\
\9elseif( bossCounter.counter:getValue() == 2 ) then\
\9\9torchBoss5.light:setColor(lightOn)\
\9\9torchBoss5.particle:fadeIn(0.001) \
\9\9torchBoss5.sound:play(\"torch_burning\")\
\9\9\
\9\9torchBoss6.light:setColor(lightOn)\
\9\9torchBoss6.particle:fadeIn(0.001) \
\9\9torchBoss6.sound:play(\"torch_burning\")\9\
\9\9\
\9\9bossTimer.timer:stop()\
\9end\
end\
\
function bossCongregation()\
\9local lightOn  = vec(1.3, 0.68, 0.35, 0)\
\
\9local boss = spawn(\"undead\", 2, 28, 22, 3, -1)\
\9local mummy1 = spawn(\"mummy\", 2, 25, 20, 1, -1)\
\9local mummy2 = spawn(\"mummy\", 2, 25, 24, 1, -1)\
\9\
\9boss.monster:setMaxHealth(450)\
\9boss.monster:setHealth(450)\
